import { GeneralContext } from "./../Context/generalcontext";

function Home() {

    const {nombre } = useContext(GeneralContext);
    const {apellido} = useContext(GeneralContext);

    return(
        <div>
        <h1>Home</h1>
        <p>{nombre}</p>
        <p>{apellido}</p>
        </div>
    );
}


export { Home };
